// Build the reverse lookup table once
const reverseAudioMap = Object.fromEntries(
  Object.entries(audioMap).map(([key, value]) => [value, key])
);


export const loadAudioIdByName = (audioName) => {
  try {
    const audioId = reverseAudioMap[audioName];
    if (!audioId) {
      console.error('❌ Audio name not found:', audioName);
      return null;
    }
    console.log('audioId found:', audioId);
    return audioId;
  } catch (error) {
    console.error('❌ Error loading audio by name:', error);
    return null;
  }
};

export const loadPDFIdByName = (PDFName) => {
  try {
    const PDFID = reverseBookMap[PDFName];
    if (!PDFID) {
      console.error('❌ PDF name not found:', PDFName);
      return null;
    }
    console.log('PDF ID found:', PDFID);
    return PDFID;
  } catch (error) {
    console.error('❌ Error loading PDF by name:', error);
    return null;
  }
};

